import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const Team = ({name}) => {
    return (
        <View style={styles.container}>
            <Image style={styles.img} source={require('../../assets/img/' + name + '.png')} />
            <Text>Team </Text>
        </View>
    )
}

export default Team

const styles = StyleSheet.create({
    container : {
        padding : 10 ,
        borderStartWidth : 1 ,
        borderRadius : 4 
    } ,
    
    img : {
        width : 100 ,
        height : 100 
    }
})
